import React from "react";
import Title from "../components/Title";
import DynamicColumnChart from "../components/dynamic charts/Dynamic Column Chart";
import DynamicLineChart from "../components/dynamic charts/Dynamic Line Chart";
const Dashboard = () => {
  return (
    <>
    <article className="dashboard">
      <Title title="Real time Chart" />
      <DynamicColumnChart/>
      <DynamicLineChart/>
      <DynamicMultiSeriesChart/>
    </article>
    </>
  );
};

export default Dashboard;
